import { createMuiTheme } from '@material-ui/core/styles';

const theme = createMuiTheme({
    palette: {
        primary: {
            main: '#FEFEFE',
        },
    },
    overrides: {
      MuiButton: {
        root: {
            borderRadius: 20,
            textTransform: 'none',
            fontWeight: 'bold',
            fontSize: 24,
            backgroundColor: '#FE5E00',
        },
      },
    },
  });

export default theme
